import "./footer.scss";
const Footer = () => {
    return (
        <footer className="footerContainer">
            <div className="row">
                <div className="column">1</div>
                <div className="column">2</div>
                <div className="column">3</div>
                <div className="column">4</div>
            </div>
        </footer> 
    )
}
export default Footer
